create table food_warehouse
(
    id                    int auto_increment comment '食材ID'
        primary key,
    foodName              varchar(32) not null,
    freezerShelfLife      int         null comment '冷冻的保质期',
    refrigeratorShelfLife int         null comment '冷藏的保质期',
    whetherOpen           int         null comment '是否开封'
)
    charset = utf8mb4;

